import React from "react";
import "./Pages.css";
import SkillsData from "../SkillsData";
import SkillsCard from "../components/SkillsCard/SkillsCard";

type SlideProps = {
  numberSlide: number;
  setNumberSlide: (number: number) => void;
};

const WhatIKnowPage: React.FC<SlideProps> = ({
  numberSlide,
  setNumberSlide,
}) => {
  function compareFn(a: number, b: number) {
    if (a > b) {
      return 1;
    }
  }

  return (
    <>
      <div className="slider-container header px-4 w-[100%]">
        <div className="wrapper">
          <h2 className="text-5xl my-8 text-center greeting font-medium ">
            What I Know
          </h2>
          <div className="skills-group_wrapper">
            <h3 className="text-start text-4xl my-8 mx-8 ">Languages</h3>
            <div className="grid grid-cols-4 mx-8">
              {SkillsData.filter((item) => item.group === "language")
                .sort(function (a, b) {
                  if (a.rating > b.rating) {
                    return -1;
                  }

                  return 0;
                })
                .map((item) => (
                  <SkillsCard item={item} />
                ))}
            </div>
          </div>
          <div className="skills-group_wrapper">
            <h3 className="text-start text-4xl my-8 mx-8 ">
              Frameworks & Libraries
            </h3>
            <div className="grid grid-cols-4 mx-8">
              {SkillsData.filter(
                (item) =>
                  item.group === "frameworks" || item.group === "libraries"
              )

                .sort(function (a, b) {
                  if (a.rating > b.rating) {
                    return -1;
                  }

                  return 0;
                })

                .map((item) => (
                  <SkillsCard item={item} />
                ))}
            </div>
          </div>
          <div className="skills-group_wrapper">
            <h3 className="text-start text-4xl my-8 mx-8 ">
            Version Control & Coding
            </h3>
            <div className="grid grid-cols-4 mx-8">
              {SkillsData.filter(
                (item) =>
                  item.group === "version-control" || item.group === "coding"
              )

                .sort(function (a, b) {
                  if (a.rating > b.rating) {
                    return -1;
                  }

                  return 0;
                })

                .map((item) => (
                  <SkillsCard item={item} />
                ))}
            </div>
          </div>
          <div className="skills-group_wrapper">
            <h3 className="text-start text-4xl my-8 mx-8 ">
            Hosting & Coding
            </h3>
            <div className="grid grid-cols-4 mx-8">
              {SkillsData.filter(
                (item) =>
                  item.group === "version-control" || item.group === "coding"
              )

                .sort(function (a, b) {
                  if (a.rating > b.rating) {
                    return -1;
                  }

                  return 0;
                })

                .map((item) => (
                  <SkillsCard item={item} />
                ))}
            </div>
          </div>

          <div className="icons">
            <div className="icon">
              <button
                className="hero-button px-2 py-2 rounded"
                onClick={() => setNumberSlide(4)}
              >
                <i className="fa-solid fa-arrow-left"></i>&nbsp;My SoftSkills
              </button>
            </div>
            <div className="icon">
              <button
                className="hero-button px-2 py-2 rounded"
                onClick={() => setNumberSlide(2)}
              >
                My Way in Germany &nbsp;
                <i className="fa-solid fa-arrow-right"></i>
              </button>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default WhatIKnowPage;
